import React, { Component } from 'react'
import axios from 'axios';

export class NoteList extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
            noteData: []
        }
    }
    
    fetchNoteData = () => {
        var encodedURI = window.encodeURI(this.props.uri);
        return axios.get(encodedURI).then(response => {
          this.setState(() => {
            return {
              noteData: response.data
            };
          });
        });
      };

    renderViewPage(){
        window.location.href="http://localhost:3000/viewNote"
    }

    componentDidMount() {
        this.fetchNoteData();
    }
    
    render() {
        const notes = this.state.noteData.map(note =>
            (<div key={note.NoteId}>
                <div>{note.NoteTitle}<button className='btn btn-info' onClick={this.renderViewPage}>View Note</button></div>
            </div>)
        )
        return (
            <div className='container'>
                {notes}
            </div>
        )
    }
}

export default NoteList
